from datasets import load_dataset
from sentence_transformers import SentenceTransformer

que_datasets = load_dataset("sadeem-ai/arabic-qna")
new_data = load_dataset("arbml/SANAD")

new_data

len(new_data["train"]["Article"])

news_dataset = new_data.filter (lambda  example : len(example["Article"])>100)
news_dataset

len(news_dataset["train"]["Article"])

news_dataset = news_dataset.shuffle(seed=42)

que_datasets

len(que_datasets["train"]["text"])

filter_data = que_datasets.filter(lambda  x : x["has_answer"]==True)

len(filter_data ["train"]["text"])

doc_texts = filter_data["train"]["text"] + news_dataset["train"][:10_000]["Article"]
doc_que = filter_data["train"]["question"]

len(doc_texts)

"""## metadata : data about data"""

metadata = [
    {
          "source" : rec["source"],
          "title" : rec["title"]
      }
    for rec in filter_data["train"]
]

metadata +=[
    {
       "source": "",
       "title": "",

    }
    for i in range(10_000)
]

len(metadata)

len(metadata)

doc_ids= [
    str(i)
      for i in range(len(doc_texts))
  ]

len(doc_ids)

doc_que[49], doc_ids[49], metadata[5000]

"""# text to vectors"""

# model_id = "intfloat/multilingual-e5-large-instruct"
model_id = "sentence-transformers/distiluse-base-multilingual-cased-v2"

device = "cuda:0"
# 1. Load a pretrained Sentence Transformer model
model = SentenceTransformer(model_id,device = device)

dim  = 512

encoded_docs = model.encode(doc_texts,show_progress_bar = True)

encoded_questions = model.encode(doc_que,show_progress_bar = True)

"""# Vector Databases

# ChromaDB
"""

import chromadb

chroma_client = chromadb.PersistentClient(path= "./chromadb-ar-docs")

collections = chroma_client.get_or_create_collection(name="Friska",  ## switch `create_collection` to `get_or_create_collection` to avoid creating a new collection every time

                                              metadata={"hnsw:space": "cosine"})

# collection.peek()
# collection.count()
# collection.modify(name="new_name")

collections.add(
     documents = doc_texts,
     ids = doc_ids,
     metadatas = metadata,
     embeddings = encoded_docs

)

"""# search_test"""

QU = "ما السبب في صغر الأسنان بالمقارنة مع حجم الفكين؟"
QU_embed = model.encode(QU)

result = collections.query(
    query_embeddings = QU_embed.tolist(),
    n_results = 3
)

print(result)

"""# FAISS"""

import faiss
import numpy as np
from copy import deepcopy

norm_encoded_docs = deepcopy(encoded_docs)
faiss.normalize_L2(norm_encoded_docs)

faiss_index = faiss.IndexIDMap(faiss.IndexFlatIP(dim))
print(faiss_index.is_trained)

faiss_index.add_with_ids(norm_encoded_docs, doc_ids)

print(faiss_index.ntotal)

"""# Search_test"""

norm_encoded_docs.shape

question = "ما السبب في صغر الأسنان بالمقارنة مع حجم الفكين؟"

# Reshape the encoded question to a 2D array with one row
encoded_question = model.encode(question).reshape(1, -1)

# Normalize the encoded question
faiss.normalize_L2(encoded_question)

results = faiss_index.search(encoded_question, 3)

model.encode(question).shape

results   # score , id

