Chroma_results = []

for i in range(len(doc_que)):
  ques = encoded_questions[i]

  results = collections.query(
      query_embeddings=ques.tolist(),
      n_results=3
  )
  Chroma_results.append(results)



chroma_insights = {
    "valid": 0,
    "similar": 0,
    "invalid": 0
}

for i in range(len(doc_que)):
  true_id = doc_ids[i]
  pred_id = Chroma_results[i]["ids"][0][0]

  true_source = metadata[i]["source"]
  pred_source = metadata[int(pred_id)]["source"]

  if str(true_id) == str(pred_id):
    chroma_insights["valid"] += 1
  elif true_source == pred_source:
    chroma_insights["similar"] += 1
  else:
    chroma_insights["invalid"] += 1



chroma_insights["valid_percentage"] = chroma_insights["valid"]/len(doc_que)
chroma_insights["similar_percentage"] = chroma_insights["similar"]/len(doc_que)
chroma_insights["invalid_percentage"] = chroma_insights["invalid"]/len(doc_que)

